          "announce": "\u003Cp\u003E\u0422\u044e\u043b\u044c\u043f\u0430\u0301\u043d (\u043b\u0430\u0442. T\u0026uacute;lipa) \u0026mdash; \u0440\u043e\u0434 \u043c\u043d\u043e\u0433\u043e\u043b\u0435\u0442\u043d\u0438\u0445 \u043b\u0443\u043a\u043e\u0432\u0438\u0447\u043d\u044b\u0445 \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u0439 \u0441\u0435\u043c\u0435\u0439\u0441\u0442\u0432\u0430 \u041b\u0438\u043b\u0435\u0439\u043d\u044b\u0435 (Liliaceae).\u003C\/p\u003E\n",
          "obj_description": "\u003Cp\u003E\u041f\u043e \u0440\u0438\u0442\u043c\u0443 \u0441\u0435\u0437\u043e\u043d\u043d\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u044f \u0442\u044e\u043b\u044c\u043f\u0430\u043d\u044b \u043e\u0442\u043d\u043e\u0441\u044f\u0442\u0441\u044f \u043a \u0432\u0435\u0441\u0435\u043d\u043d\u0438\u043c \u044d\u0444\u0435\u043c\u0435\u0440\u043e\u0438\u0434\u0430\u043c. \u0418\u0445 \u0440\u043e\u0441\u0442 \u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0430\u044e\u0442\u0441\u044f 80\u0026mdash;120 \u0434\u043d\u0435\u0439: \u0441 \u043d\u0430\u0447\u0430\u043b\u0430 \u0430\u043f\u0440\u0435\u043b\u044f \u0438 \u0434\u043e \u043a\u043e\u043d\u0446\u0430 \u0438\u044e\u043d\u044f, \u043a\u043e\u0433\u0434\u0430 \u0437\u0430\u0441\u044b\u0445\u0430\u0435\u0442 \u043d\u0430\u0437\u0435\u043c\u043d\u0430\u044f \u0447\u0430\u0441\u0442\u044c.\u003C\/p\u003E\n\n\u003Cp\u003E\u0412\u0435\u0433\u0435\u0442\u0430\u0446\u0438\u044f \u0442\u044e\u043b\u044c\u043f\u0430\u043d\u043e\u0432 \u043d\u0430\u0447\u0438\u043d\u0430\u0435\u0442\u0441\u044f \u0441 \u043e\u0442\u0440\u0430\u0441\u0442\u0430\u043d\u0438\u0435\u043c \u043b\u0438\u0441\u0442\u044c\u0435\u0432 \u0432 \u0430\u043f\u0440\u0435\u043b\u0435, \u0441\u0440\u0430\u0437\u0443 \u043f\u043e\u0441\u043b\u0435 \u0442\u0430\u044f\u043d\u0438\u044f \u0441\u043d\u0435\u0433\u0430. \u0426\u0432\u0435\u0442\u0435\u043d\u0438\u0435 \u043d\u0430\u0441\u0442\u0443\u043f\u0430\u0435\u0442 \u0432 \u0441\u0440\u0435\u0434\u043d\u0435\u043c \u0447\u0435\u0440\u0435\u0437 20\u0026mdash;30 \u0434\u043d\u0435\u0439 \u043f\u043e\u0441\u043b\u0435 \u043d\u0430\u0447\u0430\u043b\u0430 \u0432\u0435\u0433\u0435\u0442\u0430\u0446\u0438\u0438. \u0422\u044e\u043b\u044c\u043f\u0430\u043d\u044b, \u044f\u0432\u043b\u044f\u044f\u0441\u044c \u0442\u0438\u043f\u0438\u0447\u043d\u044b\u043c\u0438 \u044d\u0444\u0435\u043c\u0435\u0440\u043e\u0438\u0434\u0430\u043c\u0438, \u043e\u0447\u0435\u043d\u044c \u0447\u0443\u0432\u0441\u0442\u0432\u0438\u0442\u0435\u043b\u044c\u043d\u044b \u043a \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u0435, \u043c\u0435\u043d\u044c\u0448\u0435 \u043a \u0432\u043b\u0430\u0433\u0435 \u0438 \u043f\u043e\u0447\u0442\u0438 \u043d\u0435\u043f\u0440\u0438\u0445\u043e\u0442\u043b\u0438\u0432\u044b \u043a \u0434\u0440\u0443\u0433\u0438\u043c \u0444\u0430\u043a\u0442\u043e\u0440\u0430\u043c, \u0432\u043b\u0438\u044f\u044e\u0449\u0438\u043c \u043d\u0430 \u0440\u043e\u0441\u0442 \u0438 \u0440\u0430\u0437\u0432\u0438\u0442\u0438\u0435 \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u0439.\u003Cbr \/\u003E\n\u041f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u0441\u0442\u044c \u0446\u0432\u0435\u0442\u0435\u043d\u0438\u044f \u0437\u0430\u0432\u0438\u0441\u0438\u0442 \u043e\u0442 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u044b \u0432\u043e\u0437\u0434\u0443\u0445\u0430. \u0423 \u0431\u043e\u043b\u044c\u0448\u0438\u043d\u0441\u0442\u0432\u0430 \u0440\u0430\u0441\u0442\u0435\u043d\u0438\u0439 \u043e\u043d\u0430 \u0441\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0435\u0442 12\u0026mdash;14 \u0434\u043d\u0435\u0439. \u0412 \u043f\u0435\u0440\u0438\u043e\u0434 \u0446\u0432\u0435\u0442\u0435\u043d\u0438\u044f \u043f\u0440\u0438 \u0434\u043b\u0438\u0442\u0435\u043b\u044c\u043d\u043e\u043c \u0432\u043e\u0437\u0434\u0435\u0439\u0441\u0442\u0432\u0438\u0438 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u044b \u0441\u0432\u044b\u0448\u0435 25\u0026nbsp;\u0026deg;C \u0443 \u0442\u044e\u043b\u044c\u043f\u0430\u043d\u043e\u0432 \u043d\u0430\u0431\u043b\u044e\u0434\u0430\u0435\u0442\u0441\u044f \u0440\u0435\u0437\u043a\u043e\u0435 \u0441\u043e\u043a\u0440\u0430\u0449\u0435\u043d\u0438\u0435 \u0432\u0435\u0433\u0435\u0442\u0430\u0446\u0438\u0438, \u0438\u0434\u0451\u0442 \u043e\u0442\u043c\u0438\u0440\u0430\u043d\u0438\u0435 \u0446\u0432\u0435\u0442\u043e\u043d\u043e\u0441\u043d\u043e\u0433\u043e \u043f\u043e\u0431\u0435\u0433\u0430 \u0438 \u043e\u043f\u0440\u043e\u0431\u043a\u043e\u0432\u0430\u043d\u0438\u0435 \u043d\u0430\u0440\u0443\u0436\u043d\u043e\u0439 \u0447\u0435\u0448\u0443\u0438 \u0443 \u0437\u0430\u043c\u0435\u0449\u0430\u044e\u0449\u0438\u0445 \u043b\u0443\u043a\u043e\u0432\u0438\u0446. \u041f\u0440\u0438 \u043d\u043e\u0440\u043c\u0430\u043b\u044c\u043d\u044b\u0445 \u0442\u0435\u043c\u043f\u0435\u0440\u0430\u0442\u0443\u0440\u043d\u044b\u0445 \u0443\u0441\u043b\u043e\u0432\u0438\u044f\u0445 \u043e\u0442 \u043a\u043e\u043d\u0446\u0430 \u0446\u0432\u0435\u0442\u0435\u043d\u0438\u044f \u0434\u043e \u043e\u043a\u043e\u043d\u0447\u0430\u043d\u0438\u044f \u0432\u0435\u0433\u0435\u0442\u0430\u0446\u0438\u0438 \u043f\u0440\u043e\u0445\u043e\u0434\u0438\u0442 4\u0026mdash;5 \u043d\u0435\u0434\u0435\u043b\u044c.\u003C\/p\u003E\n\n\u003Cp\u003E\u0421\u0442\u0435\u0431\u0435\u043b\u044c, \u0446\u0432\u0435\u0442\u043e\u043a, \u043b\u0438\u0441\u0442\u044c\u044f \u0438 \u043a\u043e\u0440\u043d\u0438\u0026nbsp;\u0026mdash; \u043e\u0434\u043d\u043e\u043b\u0435\u0442\u043d\u0438\u0435, \u0442\u043e \u0435\u0441\u0442\u044c \u0436\u0438\u0432\u0443\u0442 \u043e\u0434\u043d\u0443 \u0432\u0435\u0433\u0435\u0442\u0430\u0446\u0438\u044e. \u041b\u0443\u043a\u043e\u0432\u0438\u0446\u0430, \u0432 \u043e\u0442\u043b\u0438\u0447\u0438\u0435 \u043e\u0442 \u043d\u0438\u0445,\u0026nbsp;\u0026mdash; 2,5 \u0433\u043e\u0434\u0430, \u0432 \u0442\u0435\u0447\u0435\u043d\u0438\u0435 \u044d\u0442\u043e\u0433\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0438 \u0444\u043e\u0440\u043c\u0438\u0440\u0443\u0435\u0442\u0441\u044f \u0435\u0451 \u0441\u043c\u0435\u043d\u0430\u0026nbsp;\u0026mdash; \u0437\u0430\u043c\u0435\u043d\u044f\u044e\u0449\u0430\u044f, \u0434\u043e\u0447\u0435\u0440\u043d\u044f\u044f \u043b\u0443\u043a\u043e\u0432\u0438\u0446\u0430, \u0430 \u0442\u0430\u043a\u0436\u0435 \u043d\u0435\u0441\u043a\u043e\u043b\u044c\u043a\u043e \u0431\u043e\u043b\u0435\u0435 \u043c\u0435\u043b\u043a\u0438\u0445 \u043b\u0443\u043a\u043e\u0432\u0438\u0447\u0435\u043a\u0026nbsp;\u0026mdash; \u0434\u0435\u0442\u043e\u043a.\u003C\/p\u003E\n\n\u003Cp\u003E\u0420\u0430\u0437\u043c\u043d\u043e\u0436\u0430\u0435\u0442\u0441\u044f \u0442\u044e\u043b\u044c\u043f\u0430\u043d, \u043a\u0440\u043e\u043c\u0435 \u0441\u0435\u043c\u044f\u043d, \u0435\u0449\u0451 \u043b\u0443\u043a\u043e\u0432\u0438\u0447\u043a\u0430\u043c\u0438\u0026nbsp;\u0026mdash; \u0434\u0435\u0442\u043a\u0430\u043c\u0438, \u0440\u0430\u0437\u0432\u0438\u0432\u0430\u044e\u0449\u0438\u043c\u0438\u0441\u044f \u043f\u0440\u0438 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0438\u0438 \u0441\u0442\u0435\u0431\u043b\u0435\u0439 \u0432 \u0437\u0435\u043c\u043b\u0435.\u003C\/p\u003E\n",
